<script>
import { defineComponent, onMounted, ref, computed } from "vue";
import { gsap } from "gsap";

export default defineComponent({
  name: "Home",
  setup() {
    const amt1 = 7;
    const amt2 = 140;
    const firstBox = ref(null);
    const graphic = ref(null);
    const stepper = ref(null);
    // TODO Measure screen and set that as width and height.
    const frame = ref({
      x: 0,
      y: 0,
      width: 10000,
      height: 7000
    });
    const viewBox = computed(
      () =>
        `${frame.value.x} ${frame.value.y} ${frame.value.width} ${frame.value.height}`
    );

    onMounted(() => {
      frame.value = firstBox.value.getBBox();
      graphic.value.setAttribute("viewBox", viewBox.value);
    });

    function zoomOutCompletely() {
      console.log("zoomOutCompletely -> zoomOutCompletely");
      const svgDimensions = graphic.value?.getBBox();
      frame.value = svgDimensions;
      gsap.to(graphic.value, 1.5, {
        attr: { viewBox: viewBox.value },
        rotation: 60
      });
    }

    return {
      firstBox,
      graphic,
      viewBox,
      zoomOutCompletely
    };
  }
});
</script>

